import React from 'react';

function Logs(props) {
    const logs = props.logs;
    console.log(logs);
    const allLogs = logs.map((log, i) =>
        <div key={i}>
            {log.time + ": " + log.msg}
        </div>
    );

    return (
        <div>
            {allLogs}
        </div>
    );
}

export default Logs;
